import './App.css';
import "openbridge-web-components";
import TrackableObject from './TrackableObject';

function App() {
  return (
    <div className="App">
      <div>
        <TrackableObject />
      </div>
      <html lang="en" theme="night">
        <head>
          <script src="https://unpkg.com/openbridge-web-components@0.2.1"></script> 
          <link rel="stylesheet" href="https://unpkg.com/openbridge-css@0.2.1/dist/css/openbridge.css"></link>
        </head>
        <body>
          <ob-azimuth-large target="90" value = "80" angle = "45" targetAngle="60"/>
          <button style={{ width: 512, height: 144 }} ></button>
        </body>
      </html>
    </div>
  );
}

export default App;
